ectItem with icons<\/nobr>',uJe='<nobr>A SelectItem with styled entries<\/nobr>',wUe='<nobr>A combobox with icons<\/nobr>',xUe='<nobr>A combobox with styled entries<\/nobr>',mUe='<nobr>A plain text field<\/nobr>',LIe='<nobr>A simple ComboBoxItem<\/nobr>',vUe='<nobr>A simple combobox<\/nobr>',AUe='<nobr>Direct date input<\/nobr>',oGe='<nobr>Last event: (mouse over the canvas below...)<\/nobr>',qGe='<nobr>Last event: <b>',oKe='<nobr>Multi Select with icons<\/nobr>',zUe='<nobr>Picklist based date input<\/nobr>',WXe='<p><b>Click<\/b> on any cell of the &quot;Value Field&quot; column to start editing. This example illustrates have cell editors can be customized for the <b>same<\/b> ListGridField, but different records using ListGrid.setEditorCustomizer(..)<\/p>',dYe='<p><b>Click<\/b> on any cell to start editing, then <b>Tab<\/b> or <b>Down Arrow<\/b> past the last row in the grid to create a new row.<\/p><p>Alternatively, click the <b>Edit New<\/b> button to create a new data-entry row at the end of the grid.<\/p>',cYe='<p><b>Click<\/b> on any cell to start editing. Use <b>Tab<\/b>, <b>Shift-Tab<\/b>, <b>Up Arrow<\/b>, and <b>Down Arrow<\/b> to move between cells.<\/p><p>Changes are saved automatically when you move to another row. Press <b>Enter<\/b> to save the current row and dismiss the editors, or <b>Esc<\/b> to discard changes for the current row and dismiss the editors.<\/p>',bYe='<p><b>Click<\/b> on any cell to start editing. Use <b>Tab<\/b>, <b>Shift-Tab<\/b>,<b>Up Arrow<\/b>, and <b>Down Arrow<\/b> to move between cells.<\/p><p>Press <b>Enter<\/b> to save the current rowand dismiss the editors, or <b>Esc<\/b> to discard changes for the current cell and dismissthe editors.<\/p>',GWe='<p><b>Formula and Summary fields<\/b> provide built-in wizards for end users to define formula fields that can compute values using other fields, or summary fields that can combine other fields with intervening / surrounding text. Available in all DataBoundComponents, easy to persist as preferences.<\/p><p>The Formula and Summary Builder are accessible from the grid header context menu. They can also be invoked programatically as demonstracted by clicking the buttons in this sample<\/p><p>Launch the Formula Builder and enter the title of the new field, and the desired formula. For example, enter <b>Population Density<\/b> for the field name and in the formula field enter <b>A / B<\/b>. As indicated in the dialog, A represents the Population field, and B represents the Area field. Notice that you can now sort on this newly added <b>Population Density<\/b> field just like any other field. Click the help icon to view the various supported inbuilt functions.<\/p><p>Next launch the Summary Builder and enter the title of the new field, and the Summary formulation. For example, enter <b>County (Flag)<\/b> for the field name and enter <b>#B (#A)<\/b> in the summary field.<\/p>',l1e="<p>A RibbonBar is a customized ToolStrip which displays controls in separately titled RibbonGroups.<\/p><p>The RibbonBar controls the overall presence, placement and text-alignment of each group's title and these can be overridden for individual groups. Groups can have multiple rows of controls (group.numRows) and additional columns of rows are automatically added when that number is exceeded. Controls can also span multiple rows (control.rowSpan).<\/p><p>The example below demonstrates a RibbonBar using it's default RibbonGroup and IconButton/IconMenuButton classes to show various groups with different layouts. You can see groups with horizontal and vertical buttons, some of each showing their menuIcons. The 'File' and 'Undo' buttons also have their showMenuIconOver attribute set to true, which causes mouseOver styling on the menuIcon.<\/p>",RSe='<p>A special type of form control called a CanvasItem allows any kind of SmartClient widget to participate in form layout and values management.<\/p><p>Drag resize the form (blue bordered area) &mdash; notice how the embedded ListGrid fills the available space.<\/p><p>The embedded ListGrid starts out showing the initial value provided to the form ("Germany"). Click the button titled "Set Value: France" to provide a new value to the form, causing the CanvasItem to display this value.<\/p><p>Click on any country in the list &mdash; the form picks up the value and fires standard change events, causing new values to be displayed in a Label.<\/p><p>This CanvasItem provides functionality similar to an HTML &lt;select multiple&gt;, however, because it\'s based on a ListGrid, any ListGrid behavior could be added: data paging, drag and drop, hovers, inline search, inline editing, grouping, etc.<\/p>',i2e='<p>Begin opening folders and note the prompt which briefly appears during server fetches.<\/p><p>DataBound Trees support load on demand. When a folder is opened for the first time, the tree asks the server for the children of the node just opened.<\/p>',TZe='<p>Begin typing a country name into in the filter box for the Country column. Grids can be configured to filter as you type..<\/p>',qXe='<p>By default, grids used in a Layout will fill available space, allowing users to show and hide other components on the screen in order to view and interact with more data at once in the grid.<\/p><p>Imagine that the blue outline represents all the space that is available for this interface. Click on the "Details" header to hide the tabs and reveal more rows.<\/p><p>Click on the resizebar next to the Navigation tree to hide it, allowing more space for columns.<\/p>',kXe='<p>Change the filter to show the grid resizing within the constraint of its maximum autofit rows.<\/p><p>Enter a country filter of "cook island" to see the grid shrink down to minimum size. <\/p><p>Change the country filter to "island" to show the grid at almost maximum size, but not scrolling.<\/p><p>Change the country filter to "land" to show the grid scrolling because its maximum autofit size (10) isn\'t large enough to display all rows.<\/p>',GYe='<p>Click "Load Schema" to load a supplyItem DataSource from XML Schema (XSD) format, then extend that schema with Smart GWT-specific presentation attributes, and bind the Grid and Form to it.<\/p><p>Note that the internal "itemId" field has been hidden from the user, some fields have been retitled, and default editors overriden.<\/p>',KOe='<p>Click "Save" to see validation errors derived from an JSON response. Validation errors expressed in application-specific JSON formats can be communicated to visual components by implementing DataSource.setResponseTransformHandler().<\/p> <p>The resulting validation errors will be displayed and tracked by forms and editabled grids.<\/p>',rPe='<p>Click "Save" to see validation errors derived from an XML response. Validation errors expressed in application-specific XML formats can be communicated to visual components by implementing DataSource.setResponseTransformHandler(). The resulting validation errors will be displayed and tracked by forms and editabled grids.<\/p>',CSe='<p>Click "Validate" to see validation errors triggered by rules both in this form and in the DataSource.<\/p><p>Screen-specific fields and validation logic, such as the duplicate password entry box, can be added to a particular form while still sharing schema information that applies to all views.<\/p>',pYe='<p>Click and drag to select cells, then either right-click or press the <b>Copy<\/b> button to bring up a dialog that can be used to copy and paste values to an Excel spreadsheet<\/p>',AGe='<p>Click and hold on the "Save" button to see the icon change as the button goes down. Note that the binoculars icon does not change when the button goes down.<\/p> <p>Click "Disable Save" to see the icon change to reflect disabled state. Button icons can be left or right oriented, and can optionally react to any state of the button.<\/p>',fKe='<p>Click on "Department" or "Category" below to show hierarchical menus.<\/p><p>The "Category" menu loads options dynamically from the SupplyCategory DataSource. Notice how the Tree data is fetched on demand when first accessed.<\/p>',b3e='<p>Click on "Show Window" to show a modal window.<\/p><p>Note that the "Touch This" button no longer shows rollovers or an interactive cursor, nothing outside the window can be clicked, clicks outside the window cause the window to flash, and tabbing remains in a closed loop cycling through only the contents of the window.<\/p>',fYe='<p>Click on any cell to start editing, then <b>Tab<\/b> or <b>Down Arrow<\/b> past the last row in the grid to create a new row.<\/p><p>Alternatively, click the Edit New button to create a new data-entry row at the end of the grid. Unlike the other editing examples, none of your changes are being automatically saved to the server. Note how Smart GWT highlights changed values, and new rows.<\/p><p>Click the "Save" button to save all your changes at once, or click the "Discard" button to discard all your changes (including any new rows) and revert to the data as it was before you started editing.<\/p>',j0e='<p>Click on any section header showing an arrow to expand and collapse it (the "Green Cube" section is marked not collapsible).<\/p><p>Click on the "Expand Blue" and "Collapse Blue" buttons to expand and collapse the blue section externally.<\/p>',QJe='<p>Click on the SelectItem on the left to see the full set of data. You can enter filter criteria directly on the drop-down list in either field to filter the set of options down to a managable size. <\/p><p>Now move focus to the ComboBoxItem and start typing. The set of options displayed are automatically filtered against both fields as you type. Tab or Enter keypress will complete selection.<\/p>',FYe='<p>Click the "Remove" button to remove the selected item.<\/p>',sSe='<p>Click the radio buttons to apply different CSS styles to the text. Click the CSS tab for CSS class definitions.<\/p><p>This container auto-sizes to the styled text.<\/p>',vZe='<p>Click to select a single row in the grid. Shift-click to select a continuous range of rows.<\/p><p>Ctrl-click to add or remove individual rows from the selection.<\/p>',P0e='<p>Custom controls may appear on Tab Bars.<\/p>',v0e='<p>Custom controls may appear on section headers.<\/p>',iZe='<p>DataBoundComponents allow end-users to create \'hilites\' with rules based on the values of data. There are two sorts of hilites: simple hilites, which allow a single criterion based on a single field to affect a single target field (the same one), and Advanced hilites, which allow very complex criteria, based on multiple fields, to affect multiple target fields.<\/p><p>Click the "Edit Hilites" button below to show the HiliteEditor interface. To set up a simple hilite, click on the "Area (km<sup>2<\/sup>)" record in the list to the left. When the simple hilite rule appears on the right, select the "greater than" operation from the drop-down box, type "5000000" into the value textBox, select a color from the \'Color\' picker widget and click \'Save\'. You\'ll see that all "Area (km<sup>2<\/sup>)" values in the grid that exceed 5000000 are now hilighted in your chosen color.<\/p><p>Now, add an Advanced criteria. Again, click the "Edit Hilites" button and then click the "Add Advanced Rule" button in the top left of the HiliteEditor - you\'ll now see the AdvancedHiliteEditor window. Add a new criterion that specifies <i>GDP ($M) greater than 1000000<\/i>. Click the green plus icon beneath the criterion and add a second one, this time specifying <i>Area (km<sup>2<\/sup>) less than 500000<\/i>. In the list below, select both "GDP ($M)" and "Area (km<sup>2<\/sup>)" and select a background color. Clicking \'Save\' now will update the grid, showing both GDP and Area data in your selected background color, when GDP is higher than 1 million and Area is less than <i>500,000<\/i>.<\/p><p>You can easily provide users with the ability to save and restore their hilite information - all you need is the ability to save a string. Click the button below to see the grid\'s hilite state retrieved and serialized, by calling <i>getHiliteState()<\/i>, the grid destroyed and it\'s hilite-state restored to another grid via <\/i>setHiliteState()<\/i>.<\/p> ',$Oe='<p>DataSources can bind directly to JSON data where records appear as an Array of JavaScript Objects with field values as properties.<\/p><p>This approach of loading simple JSON data over HTTP can be used with PHP and other server technologies.<\/p>',DPe='<p>DataSources can extract field values from complex XML documents via XPath expressions. Note how the address fields, which are represented in the contacts data as a subelement, appear as columns in the grid.<\/p><p>This approach of loading simple XML data over HTTP can be used with PHP and other server technologies.<\/p>',Z$e='<p>Demonstrates a range of Smart GWT GUI components, data binding operations, and layout managers in a single-page application.<\/p>',JRe='<p>Drag and drop to copy items from the first list to the second list. You can drag over the top or bottom edge of a scrolling list to scroll in that direction before dropping.<\/p><p>You can also use the various transfer icons to move / reorder records. The icons shown below are part of the standard library and is accessible using the constants in the class TransferImgButton.<\/p>',l2e='<p>Drag and drop to move parts and folders within and between the trees. You can open a closed folder by pausing over it during a drag interaction (aka "spring loaded folders").<\/p>',SVe='<p>Drag employee records into the Project Team Members list. Smart GWT recognizes that the two dataSources are linked by a foreign key relationship, and automatically uses that relationship to populate values in the record that is added when you drop. Smart GWT also populates fields based on current criteria and maps explicit titleFields as necessary.<\/p><p>In this example, note that Smart GWT is automatically populating all three of the fields in the teamMembers dataSource, even though none of those fields is present in the employees dataSource we are dragging from. Change the "Team for Project" select box, then try dragging employees across; note that the Project Code column is being correctly populated for the dropped records.<\/p>',tZe='<p>Drag to select a range of rows. Alternatively a single row in the grid and then Shift-click to select a continuous range of rows.<\/p><p>Ctrl-click to add or remove individual rows from the selection.<\/p>',QZe="<p>DynamicForms and FormItems are capable of parsing simple expressions entered as part of their values, when allowExpressions is true on either entity. ListGrids use this facility, when showFilterEditor and allowFilterExpressions are true, to allow expressions to be entered directly into the FormItems displayed in the filterEditor.<\/p><p>Below is a ListGrid with a FilterEditor and allowFilterExpressions: true. Some expression-based filter-criteria have been applied via initialCriteria: the list displays countries with no 'i's in the country name, with a Capital that starts with a letter &quot;A&quot; through &quot;F&quot; and with a population less than 1 million or more than 100 million.<\/p><p>See the table on the right for the supported expression-symbols. Note that logical &quot;and&quot; and &quot;or&quot; expressions are treated as text in text-based fields and ignored.<\/p>",sYe='<p>Each tab below holds one data grid component. Drag to select cells within the grid, then use the <b>Copy<\/b> button to copy that data to the clipboard.  Click the <b>Paste<\/b>  button below any grid to paste the copied data into that grid.<\/p>',Z1e="<p>First choose an employee via the menu to see that employee's direct reports in the ListGrid.<\/p><p>Click on employees in the tree to edit them, and drag and drop employees to rearrange them. <p>Changing an employee's salary in the grid will be automatically reflected in the tree.<\/p><p>Dragging an employee to another manager in the tree will make that employee appear or disappear in the grid if the grid is showing the original or new manager's employees.<\/p><p>Changes made in the tree or ListGrid are automatically saved to the server and reflected in the other components.<\/p>",VYe='<p>Grids support multiple levels of grouping, including a built-in dialog that allows users to configure grouping.  This is enabled by a single setting: <code>canMultiGroup<\/code>.<p>The grid below is grouped by Category, then by Ship Date.  Push the "Configure Grouping" button to launch a dialog for configuring multi-level grouping.  This can also be accessed from the drop-down menu on any column header, via the "Configure Grouping..." menu item.',REe='<p>HLayout and VLayout containers manage the stacked positions and sizes of multiple member components.<\/p><p>Resize the browser window to reflow these layouts.<p>',NWe='<p>HeaderSpans are a second level of headers that appears above the normal ListGrid headers, providing a visual cue for grouping.<\/p><p>Resize columns and note that the HeaderSpans change accordingly. Right-click in the header and note that you can hide and display spanned columns as a group, as well as individually.<\/p>',fZe='<p>Hiliting can be applied to any field in a DataBoundComponent, including custom formula and summary fields.<\/p><p>Launch the Formula Builder and enter the title of the new field, and the desired formula. In this case, enter Population Density for the field title and in the formula field enter <b>A / B<\/b>. As indicated in the dialog, <b>A<\/b> represents the Population field, and <b>B<\/b> represents the Area field. Notice that you can now sort on this newly added Population Density field just like any other field. Click the help icon to view the various supported inbuilt functions.<\/p><p>Now, click the "Edit Hilites" button to show the HiliteEditor interface. To set up a simple hilite on the custom <b>Population Density<\/b> field, select it in the list to the left. When the simple hilite rule appears on the right, select the "greater than" operation from the drop-down box, type "300" into the value textBox, select a color from the \'Color\' picker widget and click \'Save\'. You\'ll see that all the grid-values in the <b>Population Density<\/b> field that exceed 300 are now hilighted in your chosen color. <\/p> ',UVe='<p>In the first example, <b>Double Click<\/b> on any row to start editing. Select a value in the "Division" column to change the set of options available in the "Department" column.<\/p><p>In the second example, click the <b>Order New Item<\/b> button to add an editable row to the grid. Select a Category in the second column to change the set of options available in the "Item" column.<\/p>',kZe='<p>In this grid of Customer Orders, you can hover over a row to see a list of messages attached to the order.  This gives you a quick preview of discussion about the order, without the need to leave the list of orders.<\/p><p>In a complete application, clicking the order would lead to a detail screen showing the full order details and the ability to add to the discussion.<\/p>',wYe='<p>In this grid of Supply Categories, you can expand a row by clicking the special expansionField to see a sub-grid containing the list of Supply Items applicable to the selected Category. <\/p>',bHe='<p>In this sample the display formats for Calendar hours and dates have been customized to be 24 hour based and to have a european date format of DD/MM/YYYY.<\/p>',UYe='<p>Inline editing works normally with grouped data. Try editing the field that records are grouped by and notice that the record moves to its new group automatically.<\/p>',iWe='<p>ListGrids support displaying summaries of the current data set in various ways:<\/p><p>Fields from individual records can be summarized into a single field value. In this example the "Total" field displays a summary value calculated by multiplying the "Quantity" and "Price" fields.<\/p><p>Summaries can also be displayed for multiple records. This example shows a summary row at the end of each group in the grid as well as an overall summary row with information about every record in the grid. Note that in addition to standard summary functions such as "sum" to generate a total, or "count" to generate a count of records, completely custom functions may be used. This is demonstrated in the "Category" field where a custom function determines how many categories exist in this dataset.<\/p>',hWe='<p>ListGrids support displaying summaries of the current data set in various ways:<\/p><p>Fields from individual records can be summarized into a single field value. In this example the "Total" field displays a summary value calculated by multiplying the "Quantity" and "Price" fields.<\/p><p>Summaries can also be displayed for multiple records. This example shows a summary row at the end of each group in the grid as well as an overall summary row with information about every record in the grid. Note that in addition to standard summary functions such as "sum" to generate a total, or "count" to generate a count of records, completely custom functions may be used. This is demonstrated in the "Category" field where a custom function determines how many categories exist in this dataset.<\/p><p>As illustrated in this sample, by calling listGrid.setShowGroupSummaryInHeader(true) field summary values for each group are displayed directly in the group header node, rather than showing up at the bottom of each expanded group<\/p>',_Ve='<p>ListGrids support displaying summaries of the current data set in various ways:<\/p><p>Fields from individual records can be summarized into a single field value. In this example the "Total" field displays a summary value calculated by multiplying the "Quantity" and "Price" fields.<\/p><p>Summaries can also be displayed for multiple records. This example shows a summary row at the end of each group in the grid as well as an overall summary row with information about every record in the grid. Note that in addition to standard summary functions such as "sum" to generate a total, or "count" to generate a count of records, completely custom functions may be used. This is demonstrated in the "Category" field where a custom function determines how many categories exist in this dataset.<\/p><p>By calling ListGrid.addSummaryFunction multiple times you can apply more than one summary function to a field. This allows the developer to set up multi-line summaries - each specified summary function result will show up in a separate summary row<\/p>',nGe='<p>Mouse over the blue square to see the color respond to your position. Click and hold to see a fade. If you have a mousewheel, roll up and down to change size.<p><p>Smart GWT components support the standard mouse events in addition to custom events like "mouseStillDown".<\/p>',kYe='<p>Open an Excel spreadsheet, select some cells, and use Ctrl-C to copy them. Click the <b>Paste Cells<\/b> button to open a dialog where you can paste the data.<\/p>',yKe='<p>Open the picker in either form to select the item you want to order from the "supplyItem" DataSource.<\/p><p>The picker on the left stores the "itemId" from the related "supplyItem" records. The picker on the right stores the "SKU" while displaying multiple fields. You can scroll to dynamically load more records. This pattern works with any DataSource.<\/p>',F0e='<p>Press the "Show Section" and "Hide Section" buttons to reveal or hide the Yellow Section.<\/p><p>Showing and hiding sections lets you reuse a SectionStack for slightly different purposes, hiding or revealing relevant sections.<\/p>',zYe='<p>Right click on any column header to show a menu that allows you to freeze that column.Multiple columns may be frozen, and frozen columns may be reordered.<\/p><p>Right click on a frozen column to unfreeze it.<\/p>',jWe='<p>Rows are fetched automatically as the user drags the scrollbar. Drag the scrollbar quickly to the bottom to fetch a range near the end (a prompt will appear during server fetch).<\/p><p>Scroll slowly back up to fill in the middle.<\/p><p>Another key unique feature of Smart GWT is lazy rendering of <b>columns<\/b>. Most browsers cannot handle displaying a large number of column and have serious performance issues.Smart GWT however does not render all columns outside the visible area by default and only renders them as you scroll horizontally. You can however disable this feature if desired.<\/p><p>You can control how far ahead of the currently visible area rows should be rendered. This is expressed as a ratio from viewport size to rendered area size. The default is 1.3.<\/p><p>Tweaking drawAheadRatio allows you to make tradeoffs between continuous scrolling speed vs initial render time and render time when scrolling by large amounts.<\/p>',pKe='<p>Select "Other.." from the drop down to enter a custom value.<\/p>',EYe='<p>Select an item and use the form to change its price. The list updates automatically.<\/p>',X1e='<p>Setting frozen:true enables frozen columns for Trees.<\/p><p>Columns can be frozen and unfrozen by right-clicking on column headers.Column resize, column reorder, drag and drop and load on demand all function normally. Double click a cell to edit.<\/p>',LSe='<p>Setting the focus / cursor on the first field of a form is common requirement. Doing this in Smart GWT is as simple as setting <code>form.setAutoFocus(true)<\/code>.<\/p><p>This sample also has <code>setSelectOnFocus(true)<\/code> on the first field.<\/p>',BZe='<p>Smart GWT combines large dataset handling with adaptive use of client-side filtering.<\/p><p>Begin typing an Item name in the filter box above the "Item" column (for example type "Pens") . When the dataset becomes small enough, Smart GWT switches to client-side filtering automatically.<\/p><p>Delete part of the item name to see SmartClient automatically switch back to server-side filtering. The label underneath the grid flashes briefly every time Smart GWT needs to visit the server.<\/p>',IZe='<p>Smart GWT combines large dataset handling with adaptive use of client-side sort.<\/p><p>Click any header now and server-side sort will be used for this large dataset. Check "Limit to Dictionaries" to limit the dataset and sort again: when the dataset becomes small enough, Smart GWT switches to client-side sorting automatically.<\/p><p>The label underneath the grid flashes briefly every time Smart GWT needs to visit the server.<\/p>',e_e="<p>Smart GWT provides a unified Offline browser storage API that your programs can use for any client-side persistence task. In this example, we store the ListGrid's viewState to browser-local storage. Try resizing or reordering some columns in the grid, click \"Persist State\", then press F5 to reload, or close and re-open the browser; your changes have been remembered. Try adding a formula field to the grid and reload again. Persisting a user's preferences like this is a compelling addition to any application, and in this case we don't even need a server.<\/p><p>Offline support is provided in modern HTML5 browsers, and also in older versions of Internet Explorer (6 and greater); the underlying technologies used are very different, but the SmartClient API you use is the same regardless of browser. <\/p>",NZe='<p>Smart GWT provides special widgets for filtering date values, including recognised RelativeDate values that cause filtering relative to some other base-date.<\/p><p>The RelativeDateRangeItem allows selection of dates in three ways: you can select a preset DateRange, like "Today" or "Tomorrow", or a "ranged" date-string, such as "N days from now" and enter a quantity to associate with it, or you can directly enter a date-string in a recognized format. You can also select a date from the DateChooser by click the icon to the right of the widget. <p><p>The first example below demonstrates using a DateRangeItem in a separate DynamicForm to filter a ListGrid. Select start and end values for the range using one of the methods described above and click the "Search" button to see the data filtered according to the values in the "Nationhood" field.<\/p><p>The second example below demonstrates filtering grid data using a MiniDateRangeItem to filter data when a ListGrid is showing it\'s FilterEditor. In this example, click the Date icon in the header for the Nationhood field to open a popup DateRangeItemDialog. In the dialog, select start and end values for the range, as described above, and click Ok to close the Window. Then click the Filter button in the top right of the grid to see the data filtered. You can hover the mouse over the Nationhood field-header to see the full date-range string.<\/p>',gUe='<p>TextItems support a masked entry to restrict and format entry.<\/p><p>Overview of available mask characters <P> <table class="normal"> <tr><th>Character<\/th><th>Description<\/th><\/tr> <tr><td>0<\/td><td>Digit (0 through 9) or plus [+] or minus [-] signs<\/td><\/tr> <tr><td>9<\/td><td>Digit or space<\/td><\/tr> <tr><td>#<\/td><td>Digit<\/td><\/tr> <tr><td>L<\/td><td>Letter (A through Z)<\/td><\/tr> <tr><td>?<\/td><td>Letter (A through Z) or space<\/td><\/tr> <tr><td>A<\/td><td>Letter or digit<\/td><\/tr> <tr><td>a<\/td><td>Letter or digit<\/td><\/tr> <tr><td>C<\/td><td>Any character or space<\/td><\/tr> <tr><td>&nbsp;<\/td><\/tr> <tr><td>&lt;<\/td><td>Causes all characters that follow to be converted to lowercase<\/td><\/tr> <tr><td>&gt;<\/td><td>Causes all characters that follow to be converted to uppercase<\/td><\/tr> <\/table> <P> Any character not matching one of the above mask characters or that is escaped with a backslash (\\) is considered to be a literal. <P> Custom mask characters can be defined by standard regular expression character set or range. For example, a hexadecimal color code mask could be: <UL> <LI>Color: \\#>[0-9A-F][0-9A-F][0-9A-F][0-9A-F][0-9A-F][0-9A-F]<\/LI> <\/UL><\/p?',ASe='<p>The CustomPicker example demonstrates various custom picker icons that (YesNoMaybeItem) implemented as a "picker" that the user can pop up from a picker icon next to a form or grid value.<\/p>',sPe="<p>The RestDataSource provides a simple protocol based on XML or JSON over HTTP.<\/p><p>This protocol can be implemented with any server technology (PHP, Ruby, ..) and includes all the features of Smart GWT's databinding layer (data paging, server validation errors, cache sync, etc).<\/p><p>In this example, each DataSource operation is directed to a different XML file containing a sample response for that operationType. The server returns the data-as-saved to allow the grid to update its cache.<\/p>",QGe='<p>The calendar can automatically arrange events that share time so that each is always fully visible at its proper location. Drag one event onto or away from another to see the effect.<\/p>',CHe="<p>This calendar is bound to a dataSource. Drag events to alter their start times, and resize events to alter their durations.<\/p> <p>Click and drag in an empty cell to create new events, or click on an existing event to edit it. Notice how the red event can't be edited; This was specified within the event data itself.<\/p>",FIe="<p>This calendar is bound to an array of event data. Drag events to alter their start times, and resize events to alter their durations.<\/p><p>Click and drag in an empty cell to create new events, or click on an existing event to edit it. Notice how the red event can't be edited; This was specified within the event data itself.<\/p>",n_e='<p>This example demonstrates a DataSourceField that is based on a user created <code>SimpleType<\/code>. As illustrated in this sample, a user can create a reusable ZipCode SimpleType class with a regular expression based <code>com.smartgwt.client.widgets.form.validator.Validator<\/code> and then use this SimpleType in various DataSourceField definitions across their application for use with any DataBoundComponent like a ListGrid, TreeGrid, DynamicForm etc.<\/p><p>This is a powerful feature allows creation and reuse of domain specific "primitive" data types or types in the enterprises Common Data Model (CDM).<p>Enter a bad zip code (eg just "123") and press "Validate" to receive a validation error. Custom types can be declared based on built-in validators and re-used in multiple DataSources.<\/p>',XYe='<p>This example demonstrates hiliting in a data-driven fashion, where hilites contain no criteria, and instead the data itself is flagged by setting the <i>DataBoundComponent.hiliteProperty<\/i> attribute on each record. This method is useful when some complex server-based calculation is used to decide which records to hilite, and the client only needs to handle displaying them. <\/p> ',hZe='<p>This example demonstrates producing hilites in code. The hilites applied to the grid below match those suggested in the User Defined hilites example. Additionally, the Advanced Hilite in this example also demonstrates using <i>Canvas.imgHTML()<\/i> and the <i>htmlAfter<\/i> attribute of hilite-objects to append a warning icon to the end of each field value, as part of the hilite. <\/p><p>Hilite-objects also support an htmlBefore attribute - you can use these before and after properties to extend color-based hilites to format values, for instance, as bold or italic text using HTML tags. <\/p> ',HUe='<p>This example demonstrates two select items, both of which load data on the fly from a DataSource, where the "Category" drop-down controls the list of available items in the "Item" drop-down.<\/p><p>Try selecting a value in the "Category" drop-down list to change the set of options available in the "Item" drop-down.<\/p>',a_e='<p>This example illustrates DataSource driven widgets. The Grid and Form widgets themselves are completely driven by the DataSource definition and do not have any code specific to displaying labels or fields from either datasource.<\/p><p>Click to select a DataSource, click on records to edit them in the adjacent form, then click the "Save" button to save changes. This resuable component combines a databound form and grid into a reusable application pattern of side-by-side editing, that can be used with any DataSource.<\/p>',IVe='<p>This example illustrates embedding arbitrary widgets in ListGrid cells. Notice how reordering the column with widgets works as any other column. Smart GWT uses widget pooling to maximize efficiency however for better performance consider using one or more fields of type ListGridFieldType.ICON<\/p>.',QWe='<p>This example illustrates how a ListGrid configuration can be saved as a user preference and later restored. Notice how the position of custom fields created by the Formula Builder and Summary Builder are also captured and restored.<\/p><p>The ListGrid configuration comprises of field state, sort state and selection state and these can be obtained separately by calling ListGrid.getFieldState(), ListGrid.getSortState() and ListGrid.getSelectionState() respectively. ListGrid.getViewState() can be called to return all three states.<\/p><p>The configuration state is a String which can be sent to the server to store and later retrieve the ListGrid state.<\/p>',d2e='<p>This example illustrates how a TreeGrid configuration can be saved as a user preference and later restored. Notice how the expansion of the nodes and the position of custom fields created by the Formula Builder and Summary Builder are also captured and restored.<\/p><p>The TreeGrid configuration comprises of field state, sort state and selection state and these can be obtained separately by calling TreeGrid.getFieldState(), TreeGrid.getSortState() and TreeGrid.getSelectionState() respectively. TreeGrid.getViewState() can be called to return all three states.<\/p><p>The configuration state is a String which can be sent to the server to store and later retrieve the TreeGrid state.<\/p>',hHe='<p>This example illustrates how the Calendar event dialog and editor can be completely customized.The <b>Sharing<\/b> radio options on the event dialog is custom, as well as the <b>Repeats<\/b> and <b>Reminder<\/b> Select Items on the eventdetails edit dialog.<\/p>',D0e='<p>This example illustrates the ability to drag-reorder sections. Simply drag the headers of the sections to reorder.<\/p>',cUe='<p>This example shows a reusable CanvasItem that edits nested data structures.<\/p><p>Here, a record representing an Order contains multiple OrderItem records &mdash; in the Record for an Order the "items" field value is set to an Array of Records representing OrderItems.<\/p><p>The CanvasItem embeds an editable ListGrid to provide an editing interaction for the OrderItems right in the midst of the form. It can be used with any DataSource that has nested records.<\/p>',DHe="<p>This example uses a Timeline, a simple subclass of Calendar, to show a variety of development tasks assigned to developers over a 3-week period.  This timeline is bound to a client-side DataSource. Drag events to alter their start dates, and resize events to alter their durations. Hover over an event to see it's details or click to edit them.<\/p>",GIe="<p>This example uses a Timeline, a simple subclass of Calendar, to show a variety of development tasks assigned to developers over a 3-week period.  This timeline is bound to an array of event data. Drag events to alter their start dates, and resize events to alter their durations. Hover over an event to see it's details or click to edit them.<\/p>",vYe="<p>This grid displays a limited number of fields from the supplyItem dataSource.<\/p><p>You can expand a row by clicking the special expansionField to see a DetailViewer embedded in the expanded portion of the record which displays the rest of the data from the dataSource that isn't already visible in the grid. <\/p>",uYe="<p>This grid displays some fields from the Countries dataSource. You can expand a row by clicking the special expansionField to see the details of the selected country's background in the expanded section.<\/p>",dXe='<p>This grid hilites "Population" values greater than 1 billion or less than 50 million using a full set of compound styles (with customized background colors).<\/p><p>Mouse over or click-drag rows to see how these styles apply to different row states.<\/p>',VZe='<p>This grid is displayed pre-sorted on two fields: first by Category ascending and then by Item Name descending. As well as the field\'s title, the header of each field included in the sort configuration displays a sort-arrow indicating the direction of sort on that field and, when multiple fields are sorted, a small numeral indicating this field\'s position in the list of fields being sorted. You can hold down SHIFT and click an already sorted column-header to reverse it\'s direction, or an unsorted column- header to add that field to the list of fields being sorted. Clicking a column header without holding down SHIFT clears the current sort configuration and initializes a new sort on the selected field.<\/p><p>Click the "Multilevel Sort" button to show a MultiSortDialog. Select a set of sort properties and directions and click "Apply" to see the grid resorted by those properties.<\/p>',aXe='<p>This is an example of a ListGrid with a top level header. This is accomplished easily by adding the ListGrid to a non-collapsible SectionStackSection.<\/p>',aYe='<p>This is an example of editing with all editors active. This is done by simply calling : <pre>listGrid.setAlwaysShowEditors(true)<\/b><\/pre>',X0e='<p>Tiled views can be filtered and sorted just like ListGrids. Use the "Search" form to eliminate some tiles and watch remaining tiles animate to new positions.<\/p><p>Use the "Sort" form to change the sort direction.<\/p>',T0e='<p>Titles can be changed on the fly. Type in your name to see the "Preferences" tab change its title to include your name.<\/p><p>Note that the tab automatically sizes to accommodate the longer title - automatic sizing also happens at initialization.<\/p>',a$e='<p>To center components within layouts, set layout.align to center along the length axis (vertical axis for a VLayout, horizontal axis for an HLayout).<\/p><p>To center along the breadth axis (horizontal axis for an VLayout, vertical axis for an HLayout), set member.layoutAlign on each member that should be centered, or set layout.defaultLayoutAlign to center all members.<\/p><p>Combine both settings to center along both axes.<\/p><p>You can also use LayoutSpacers to center components. This is particularly useful if you have a layout where you want to center something in the remaining space after other components have taken the space they require.<\/p>',T1e='<p>Tree selection can be automatically propagated up and down the tree. Select a parent or child node to see how other nodes are affected.<\/p>',_1e='<p>Trees can show multiple columns of data for each node. Each column has the styling, formatting, and data type awareness features of columns in a normal grid.<\/p><p>Try drag reordering columns, or sorting by the Salary field.<\/p>',R2e='<p>Try dragging employees under new managers. Note that a position indicator line appears during drag, allowing employees to be placed in a particular order.<\/p>',U2e='<p>Try dragging employees under new managers. Note that closed folders automatically open if you hover over them momentarily.<\/p>',PZe='<p>Type "island" above the Country column, then press Enter or click the filter button (top-right corner of the grid) to show only countries with "island" in their name.<\/p><p>Select "North America" above the Continent column to filter countries by that continent. Filtering is disabled on the "Flag" and "Capital" columns.<\/p>',SZe='<p>Type "island" above the Country column, then press Enter or click the filter button (top-right corner of the grid) to show only countries with "island" in their name.<\/p><p>Select "North America" above the Continent column to filter countries by that continent.<p>',XVe='<p>Use the FilterBuilder to construct custom queries that combine multiple criteria across any field in your DataSource.<\/p><p>Note that the operator select list only shows operators suitable for the field selected, and the comparison field changes to suit the type of the selected field (for example, select field "independence" and note that the comparison field changes to a date).<\/p><p>Add clauses to your query with the "+" icon. Click "Filter" to see the result in the ListGrid.<\/p>',gWe='<p>Use the FilterBuilder to construct queries of arbitrary complexity. The FilterBuilder, and the underlying AdvancedCriteria system, support building queries with subclauses nested to any depth.<\/p><p>Add clauses to your query with the "+" icon; add nested subclauses with the "+()" button. Click "Filter" to see the result in the ListGrid.<\/p>',CYe='<p>Use the form to create a new stock item. Create an item in the currently shown category to see it appear in the filtered listing automatically.<\/p>',MZe="<p>When a FilterBuilder must work with a very large number of fields, you can set FilterBuilder.fieldDataSource to a DataSource containing records that represent the fields to display in the FieldPickers in each clause. The FilterBuilder below is created without a normal DataSource, but specifies a fieldDataSource and the FieldPicker items in each clause are populated dynamically with it's records. In this mode, the FieldPickers are represented by ComboBoxItems, rather than SelectItems, and have default settings that provide type-ahead auto-completion.<p><p>Note also that, when fieldDataSource is specified and the operator for a clause is of a type that uses a field-lookup, the valueField is also populated dynamically by the fieldDataSource.<\/p>",EIe="<p>When eventAutoArrange is true, you can have the Calendar overlap concurrent events slightly. The z-order is from left to right and the overlap-size is a percentage of event-width <\/p>. <p>If two events start at exactly the same time, the default behaviour is to reject the overlap to avoid the first event's close button from being hidden by the second event. You can see this by dropping one event onto the start-time of another below.<\/p>",YEe="<span class='exampleDropTitle'>Ajax&nbsp;&nbsp;<\/span> <b>A<\/b>synchronous <b>J<\/b>avaScript <b>A<\/b>nd <b>X<\/b>ML (AJAX) is a Web development technique for creating interactive <b>web applications<\/b>. The intent is to make web pages feel more responsive by exchanging small amounts of data with the server behind the scenes, so that the entire Web page does not have to be reloaded each time the user makes a change. This is meant to increase the Web page's <b>interactivity<\/b>, <b>speed<\/b>, and <b>usability<\/b>. (Source: <a href='http://www.wikipedia.org' title='Wikipedia' target='_blank'>Wikipedia<\/a>)",xJe="<span style='color:#0000FF;'>Blue<\/span>",wJe="<span style='color:#00FF00;'>Green<\/span>",vJe="<span style='color:#FF0000;'>Red<\/span>",CFe="<span style='font-size:22px;'>Ajax<\/span> <b>A<\/b>synchronous <b>J<\/b>avaScript <b>A<\/b>nd <b>X<\/b>ML (AJAX) is a Web development technique for creating interactive <b>web applications<\/b>. The intent is to make web pages feel more responsive by exchanging small amounts of data with the server behind the scenes, so that the entire Web page does not have to be reloaded each time the user makes a change. This is meant to increase the Web page's <b>interactivity<\/b>, <b>speed<\/b>, and <b>usability<\/b>.<br>(Source: <a href='http://www.wikipedia.org' title='Wikipedia' target='_blank'>Wikipedia<\/a>)",YDe='<span>',RZe="<table style='font-size:12;font-family:Arial,Verdana'><tr><td><b>Prefix<\/b><\/td><td><b>Operator<\/b><\/td><\/tr><tr><td>&lt;<\/td><td>lessThan<\/td><\/tr><tr><td>&gt;<\/td><td>greaterThan<\/td><\/tr><tr><td>&lt;=<\/td><td>lessThanOrEqual<\/td><\/tr><tr><td>&gt;=<\/td><td>greaterThanOrEqual<\/td><\/tr><tr><td>someValue...someValue<\/td><td>betweenInclusive<\/td><\/tr><tr><td>!<\/td><td>notEqual<\/td><\/tr><tr><td>^<\/td><td>startsWith<\/td><\/tr><tr><td>|<\/td><td>endsWith<\/td><\/tr><tr><td>!^<\/td><td>notStartsWith<\/td><\/tr><tr><td>!@<\/td><td>notEndsWith<\/td><\/tr><tr><td>~<\/td><td>contains<\/td><\/tr><tr><td>!~<\/td><td>notContains<\/td><\/tr><tr><td>=(value1|value2)<\/td><td>inSet<\/td><\/tr><tr><td>!=(value1|value2)<\/td><td>notInSet<\/td><\/tr><tr><td>#<\/td><td>isNull<\/td><\/tr><tr><td>!#<\/td><td>isNotNull<\/td><\/tr><tr><td>==<\/td><td>exact match (for fields where 'contains' is the default)<\/td><\/tr><tr><td>=.<\/td><td>matches other field-name or title<\/td><\/tr><\/table>",eke='=',hUe='>?<??????????????',Rie='A',I_e='A Porlet is a subclass of Window, so its contents can be defined in any of the ways that work for Windows. ',IIe='A few examples of styled ComboBox and SelectItems',JTe="A land of vast distances and rich natural resources, Canada became a self-governing dominion in 1867 while retaining ties to the British crown. Economically and technologically the nation has developed in parallel with the US, its neighbor to the south across an unfortified border. Canada's paramount political problem is meeting public demands for quality improvements in health care and education services after a decade of budget cuts. Canada also faces questions about integrity in government following revelations regarding a corruption scandal in the federal government that has helped revive the fortunes of separatists in predominantly francophone Quebec.",G$e='AJAX.doc',Kje='AM',Nne='AM/PM',$ne='AUTO',epe='AVG',rRe='Acceleration',zEe='Accordion / Sections',N$e='Activate',P$e='Activate Blacklist',cre='ActiveXControl',GMe='Adaptive Filter',Wye='AdaptiveFilterSample',Zye='AdaptiveSortSample',bne='Add',gOe='Add & Remove',aIe='Add 20 samples for the following new features: ...',xne='Add Level',I0e='Add Tab',FHe='Add a new calendar Timeline component',tIe='Add milti-file upload support',EHe='Add new Timeline view',jIe='Add the following 11g-specific enhancements: ...',gIe='Add the following features and update documentation: ...',eIe='Add these 4 new language packs: ...',QMe='Adding and removing columns',Tle='AdvancedCriteria',Qqe='AdvancedHiliteEditor',VJe='Advertising',kLe='Africa',cHe='Airport run',pZe='All "Europe" country records in this grid are disabled. Mouse over or drag the enabled rows, or click on any values in this grid. Notice the dragging behaviour above and below the disabled rows.',$ye='AlternateRecordStyleSample',tTe="Although ultimately a victor in World Wars I and II, France suffered extensive losses in its empire, wealth, manpower, and rank as a dominant nation-state. Nevertheless, France today is one of the most modern countries in the world and is a leader among European nations. Since 1958, it has constructed a presidential democracy resistant to the instabilities experienced in earlier parliamentary democracies. In recent years, its reconciliation and cooperation with Germany have proved central to the economic integration of Europe, including the introduction of a common exchange currency, the euro, in January 1999. At present, France is at the forefront of efforts to develop the EU's military capabilities to supplement progress toward an EU foreign policy.",OJe='An example of a MultiComboBox',IYe='Ancient',XFe='Animal',aze='AnimalXmlDS',dze='AnimatedSelectionSample',FOe='Animation',zMe='Animation Playpen',tje='Anno Domini',bMe='Anti Virus Suite',sme='Appearance',lqe='Applet',eze='ApplicationPanel',Kme='Apply',jje='Apr',Zie='April',mLe='Area (km&sup2;)',kTe="As Europe's largest economy and second most populous nation, Germany remains a key member of the continent's economic, political, and defense organizations. European power struggles immersed Germany in two devastating World Wars in the first half of the 20th century and left the country occupied by the victorious Allied powers of the US, UK, France, and the Soviet Union in 1945. With the advent of the Cold War, two German states were formed in 1949: the western Federal Republic of Germany (FRG) and the eastern German Democratic Republic (GDR). The democratic FRG embedded itself in key Western economic and security organizations, the EC, which became the EU, and NATO, while the Communist GDR was on the front line of the Soviet-led Warsaw Pact. The decline of the USSR and the end of the Cold War allowed for German unification in 1990. Since then, Germany has expended considerable funds to bring Eastern productivity and wages up to Western standards. In January 1999, Germany and 10 other EU countries introduced a common European exchange currency, the euro.",Fne='Ascending',gLe='Asia',M1e='Asset Spec Lines Stns',eve='Attempt to create Calendar. This class requires the optional Calendar module which is not present in this build.',mje='Aug',bje='August',iLe='Australia/Oceania',pne='Auto Fit',hze='AutoArrangeEventsCalendarSample',Qre='AutoFitTextAreaItem',lNe='Autofit',lXe='Autofit to rows can be made subject to a maximum. Add new rows to the grid, and note that the grid expands to show the new rows. It stops expanding once you have more than 6 rows.',jze='AutofitColumnWidthsSample',kze='AutofitColumnsSample',lze='AutofitFilterSample',oze='AutofitRowsSample',pze='AutofitValuesSample',ane='Available Fields',aSe='B',Qoe='BINARY',zoe='BOOLEAN',Tne='BOTH',wpe='BOTTOM',hJe='BR',Nke='BUTTON',Gme='Back',fke='BackCompat',lne='Background',wKe='Bag',qze='BasicTilingSample',FEe='Basics',Cqe='BatchUploader',jne='Before',sje='Before Christ',ZSe='Beijing',mQe='Below is a sampling of the shapes available in the SmartClient drawing package.',iTe='Berlin',NUe='Billy Bob',Cme='Blue',t0e='Blue Cube',k0e='Blue Pawn',hSe='Blue Piece',Nre='BlurbItem',eHe='Board of directors meeting: discussion of next months strategy',TOe='Bob',ENe='Boolean',OLe='Box',DTe='Brasilia',BTe='Brazil',UGe='Breakfast with realtor to discuss moving plans',XSe="Britain's American colonies broke with the mother country in 1776 and were recognized as the new nation of the United States of America following the Treaty of Paris in 1783. During the 19th and 20th centuries, 37 new states were added to the original 13 as the nation expanded across the North American continent and acquired a number of overseas possessions. The two most traumatic experiences in the nation's history were the Civil War (1861-65) and the Great Depression of the 1930s. Buoyed by victories in World Wars I and II and the end of the Cold War in 1991, the US remains the world's most powerful nation state. The economy is marked by steady growth, low unemployment and inflation, and rapid advances in technology.",sre='BrowserPlugin',LJe='Bug Status',Rqe='Button',lse='ButtonItem',BEe='Buttons',zGe='Buttons can automatically size to accommodate the title and icon, and resize automatically when the title is changed, notifying components around them that they have changed size.',tGe='Buttons come in three basic types: CSS buttons, single-image buttons, and multiple-image stretch buttons. All share a basic set of capabilities.',Q_e='By default, PortalLayouts make their columns equal width. Resize bars can be displayed to allow the user to change column widths. <P>Try dragging the resize bar, and see how the columns change width.<P> Try making both columns smaller. By default, the PortalLayout will extend the last column to fill the available width (preventing underflow). This behavior can be changed with the preventUnderflow attribute. <P>Try making both columns bigger. By default, the PortalLayout will scroll if the columns overflow the available width. ',u_e='By default, a PortalLayout displays menus allowing the user to add or remove columns. Try adding a column and moving some Portlets to the new column. ',nZe='By setting selectionAppearance to SelectionAppearance.CHECKBOX, the ListGrid can use checkboxes to indicate the selected state of records. Only by clicking on a checkbox will the corresponding record ia Piper',zWe='Field ',cne='Field Name',_me='Field Picker',Ime='Field is required',Ere='FieldPickerWindow',Eye='File',sIe='FileItem',ume='Filter',Vqe='FilterBuilder',Hqe='FilterClause',HAe='FilterSortTilingSample',z2e='Fire Sec Off',QDe='Firebug can make the Showcase run slow. For the best performance, we suggest disabling Firebug for this site.',NOe='First Name',EQe='First Stop Color',zte='FiscalCalendar',Bte='FiscalYear',D1e='Fit',JVe='Flag',Iqe='Flashlet',Oqe='FlowLayout',FTe="Following three centuries under the rule of Portugal, Brazil became an independent nation in 1822 and a republic in 1889. By far the largest and most populous country in South America, Brazil overcame more than half a century of military intervention in the governance of the country when in 1985 the military regime peacefully ceded power to civilian rulers. Brazil continues to pursue industrial and agricultural growth and development of its interior. Exploiting vast natural resources and a large labor pool, it is today South America's leading economic power and a regional leader. Highly unequal income distribution remains a pressing problem.",_Se="For centuries China stood as a leading civilization, outpacing the rest of the world in the arts and sciences, but in the 19th and early 20th centuries, the country was beset by civil unrest, major famines, military defeats, and foreign occupation. After World War II, the Communists under MAO Zedong established an autocratic socialist system that, while ensuring China's sovereignty, imposed strict controls over everyday life and cost the lives of tens of millions of people. After 1978, his successor DENG Xiaoping and other leaders focused on market-oriented economic development and by 2000 output had quadrupled. For much of the population, living standards have improved dramatically and the room for personal choice has expanded, yet political controls remain tight.",e3e='For input string: "',IAe='FormDataboundDependentSelectsSample',ste='FormItem',wse='FormItemIcon',JAe='FormServerJsonValidationSample',KAe='FormServerXmlValidationSample',PAe='FormatDropDownSample',QAe='FormatRelatedValueSample',RAe='FormatValuesSample',a2e='Formatter interfaces allow you to add custom tree titles.',wEe='Forms',IMe='Formula &amp; Summary Builder',WWe='Formula Builder',OHe='Formula and Summary fields for ListGrid',SAe='FormulaSummaryBuilderSample',ATe='Founded in the 12th century, the Principality of Muscovy, was able to emerge from over 200 years of Mongol domination (13th-15th centuries) and to gradually conquer and absorb surrounding principalities. In the early 17th century, a new Romanov Dynasty continued this policy of expansion across Siberia to the Pacific. Under PETER I (ruled 1682-1725), hegemony was extended to the Baltic Sea and the country was renamed the Russian Empire. During the 19th century, more territorial acquisitions were made in Europe and Asia. Repeated devastating defeats of the Russian army in World War I led to widespread rioting in the major cities of the Russian Empire and to the overthrow in 1917 of the imperial household. The Communists under Vladimir LENIN seized power soon after and formed the USSR. The brutal rule of Iosif STALIN (1928-53) strengthened communist rule and Russian dominance of the Soviet Union at a cost of tens of millions of lives. The Soviet economy and society stagnated in the following decades until General Secretary Mikhail GORBACHEV (1985-91) introduced glasnost (openness) and perestroika (restructuring) in an attempt to modernize Communism, but his initiatives inadvertently released forces that by December 1991 splintered the USSR into Russia and 14 other independent republics. Since then, Russia has struggled in its efforts to build a democratic political system and market economy to replace the strict social, political, and economic controls of the Communist period. While some progress has been made on the economic front, recent years have seen a recentralization of power under Vladimir PUTIN and the erosion of nascent democratic institutions. A determined guerrilla conflict still plagues Russia in Chechnya and threatens to destabilize the North Caucasus region.',cJe='France',y2e='Francine Dugas',TAe='FreeSpaceSample',Ije='Fri',Bje='Friday',zme='From',uNe='Frozen Columns',UAe='FrozenColumnsSample',MUe='Full Name',dLe='G8',HWe='GDP',uXe='GDP ($B)',oLe='GDP ($M)',LXe='GDP (per capita)',_Ie='GM',BIe='Garret Monroe',Pqe='Gauge',ate='GaugeSector',DLe='Gender',I1e='Gene Porter',aJe='Germany',PIe='Giraffe',QIe='Goat',cLe='Government',X2e='Grab the window by its title bar to move it around. Resize it by the right or bottom edge.',kte='Gradient',IDe='Graphite',pTe="Great Britain, the dominant industrial and maritime power of the 19th century, played a leading role in developing parliamentary democracy and in advancing literature and science. At its zenith, the British Empire stretched over one-fourth of the earth's surface. The first half of the 20th century saw the UK's strength seriously depleted in two World Wars. The second half witnessed the dismantling of the Empire and the UK rebuilding itself into a modern and prosperous European nation. As one of five permanent members of the UN Security Council, a founding member of NATO, and of the Commonwealth, the UK pursues a global approach to foreign policy; it currently is weighing the degree of its integration with continental Europe. A member of the EU, it chose to remain outside the Economic and Monetary Union for the time being. Constitutional reform is also a significant issue in the UK. The Scottish Parliament, the National Assembly for Wales, and the Northern Ireland Assembly were established in 1999, but the latter is suspended due to wrangling over the peace process.",Dme='Green',r0e='Green Cube',m0e='Green Pawn',iSe='Green Piece',nMe='Grid Cell Widgets',JMe='Grid Summaries',VAe='GridCellWidgetsSample',WAe='GridComponentsSample',XAe='GridCustomEditorsSample',YAe='GridCustomGrouping  Southeast Asia. After its defeat in World War II, Japan recovered to become an economic power and a staunch ally of the US. While the emperor retains his throne as a symbol of national unity, actual power rests in networks of powerful politicians, bureaucrats, and business executives. The economy experienced a major slowdown starting in the 1990s following three decades of unprecedented growth, but Japan still remains a major economic power, both in Asia and globally. In 2005, Japan began a two-year term as a non-permanent member of the UN Security Council.",ULe='In Stock',ZVe='Independence',$Ie='India',WTe='Indonesia',pLe='Info',DNe='Integer',hNe='Interaction',dGe='Interesting Facts',hve="Invalid call to setDataSource() passing null.  If you're having trouble with loading DataSources, please see the following FAQ: http://forums.smartclient.com/showthread.php?t=8159#aDSLoad",Q2e='Inventory Ck',eJe='Italy',wTe="Italy became a nation-state in 1861 when the regional states of the peninsula, along with Sardinia and Sicily, were united under King Victor EMMANUEL II. An era of parliamentary government came to a close in the early 1920s when Benito MUSSOLINI established a Fascist dictatorship. His disastrous alliance with Nazi Germany led to Italy's defeat in World War II. A democratic republic replaced the monarchy in 1946 and economic revival followed. Italy was a charter member of NATO and the European Economic Community (EEC). It has been at the forefront of European economic and political unification, joining the Economic and Monetary Union in 1999. Persistent problems include illegal immigration, organized crime, corruption, high unemployment, sluggish economic growth, and the low incomes and technical standards of southern Italy compared with the prosperous north.",CJe='Item',SJe='Item (ComboBox)',RJe='Item (Select)',NJe='Item Name',sCe='ItemRecord',tCe='ItemSupplyLocalDS',uCe='ItemSupplyXmlDS',Mxe='Items',Oie='J',YIe='JA',eoe='JSON',fte='JSONEncoder',t2e='Jacques ity separatist guerilla movement in Papua.",gFe='The HTMLFlow component displays a chunk of standard HTML in a free-form, flowable region.',hFe='The HTMLPane component displays a chunk or page of standard HTML in a sizeable, scrollable pane.',kFe='The Img component displays images in the standard web formats (png, gif, jpg) and other image formats supported by the web browser.',hTe='The Indus Valley civilization, one of the oldest in the world, dates back at least 5,000 years. Aryan tribes from the northwest infiltrated onto Indian lands about 1500 B.C.; their merger with the earlier Dravidian inhabitants created the classical Indian culture. Arab incursions starting in the 8th century and Turkish in the 12th were followed by those of European traders, beginning in the late 15th century. By the 19th century, Britain had assumed political control of virtually all Indian lands. Indian armed forces in the British army played a vital role in both World Wars. Nonviolent resistance to British colonialism led by Mohandas GANDHI and Jawaharlal NEHRU brought independence in 1947. The subcontinent was divided into the secular state of India and the smaller Muslim state of Pakistan. A third war between the two countries in 1971 resulted in East Pakistan becoming the separate nation of Bangladesh. Despite impressive gains in economic investment and output, India faces pressing problems such as the ongoing dispute with Pakistan over Kashmir, massive overpopulation, environmental degradation, extensive poverty, and ethnic and religious strife.',oFe='The Label component adds alignment, text wrapping, and icon support for small chunks of standard HTML.',N_e='The Portlets on the left have a height which requires the PortalLayout to scroll. By default, each column scrolls individually. If the large Portlets are dragged to the right column, then it will scroll. PortalLayouts respect the height that has been set for Portlets and scroll columns if necessary. <P>If it is preferred to have the whole PortalLayout scroll together, try setting the columnOverflow to "visible". Other combinations of overflow and columnOverflow are also possible. ',AJe='The SelectItem displays multiple fields in a ListGrid. You can scroll to dynamically load more records. This pattern works with any DataSource.',JJe='The SelectItem displays multiple fields in a ListGrid. You can scroll to dynamically load more records. This pattern works with any DataSource. When a value formatter is installed on a ComboBoxItem, setFormatOnBlur(true) causes the formatting to be applied only when the item does not have focus - formatting is removed when the item receives focus.',HIe='The calendar can focus in on workday hours, giving a clearer view of events that occur durring the work day. The boundaries of the workday itself can also be customized.',aFe='The future has a way of arriving unannounced.',Vpe='The long value ',SLe='The maximum allowed precision is 2',MTe='The site of advanced Amerindian civilizations, Mexico came under Spanish rule for three centuries before achieving independence early in the 19th century. A devaluation of the peso in late 1994 threw Mexico into economic turmoil, triggering the worst recession in over half a century. The nation continues to make an impressive recovery. Ongoing economic and social concerns include low real wages, underemployment for a large segment of the population, inequitable income distribution, and few advancement opportunities for the largely Amerindian population in the impoverished southern states. Elections held in July 2000 marked the first time since the 1910 Mexican Revolution that the opposition defeated the party in government, the Institutional Revolutionary Party (PRI). Vicente FOX of the National Action Party (PAN) was sworn in on 1 December 2000 as the first chief executive elected in free and fair elections.',Dne='Then by',xXe='This ListGrid binds to a DataSource that loads data from a remote JSON data provider. This approach of loading simple JSON data over HTTP can be used with PHP and other server technologies.',CXe='This ListGrid binds to a DataSource that loads data from a remote XML data provider. This approach of loading simple XML data over HTTP can be used with PHP and other server technologies.',zXe='This ListGrid binds to a client-only DataSource that loads data from a local data array. This technique is appropriate for client-only rapid prototyping when the production application will support add or update (write operations),  switchable data providers (JSON, XML, WSDL, Java), arbitrarily large data sets (1000+ records), or a data model that is shared by multiple components.',AXe='This ListGrid merges field settings from both the component "fields" (for presentation attributes) and the countryDS DataSource (for data model attributes). This is the usual approach to customize the look and feel of a data-bound component.',yXe='This ListGrid takes its field (column) settings from the "fields" property of the component definition only. This technique is appropriate for presentation-only grids that do not require data binding.',tXe='This ListGrid takes its field (column) settings from the country DataSource specified in the "dataSource" property of the component definition. This technique is appropriate for easy display of a shared data model with the default UI appearance and behaviors.',wXe='This ListGrid uses an inline data array in the component definition. This technique is appropriate for very small read-only data sets, typically with static data values.',Jme='This data not available while offline',wWe='This example illustrates how you can customize header context menus.',EWe='This grid applies custom formatters to the "Nationhood" and "Area" columns. Click on the "Nationhood" or "Area" column headers to sort the underlying data values.',jZe='This grid displays a limited number of fields from the supplyItem dataSource. When you hover over a row, the system goes to the server to retrieve the entire record, creates a DetailViewer to display that data and shows it as the hoverComponent. See the code in the overridden getCellHoverComponent() method.',cXe='This grid hilites "Population" values greater than 1 billion or less than 50 million using additive style attributes (text color and weight).',g_e='This is an example of a DateChooser control',E1e='This is an example of a Vertical ToolStrip.',ZZe='This is an example of integrating GWT Widgets with Smart GWT components.',kWe='This sample illustrates alternate record styles to create ledger effect for easier reading. To disable alternate record styles ListGrid.setAlternateRecordStyles(false) can be called.',hXe='This sample illustrates the display of row numbers. This is done by calling setShowRowNumbers(true)',MYe='This sample shows that a single ListGrid field may be grouped in more than one way, by setting its groupingModes property, a valueMap. By default the grid is shown grouped by the "Hemisphere" mode of the Continent field--you can also group by the Continent Name. Similarly, there are two ways to group by the Nationhood field. You must define the getGroupValue() method of a field to apply logic appropriate to the field\'s groupingMode.',GKe='Threatened',Hje='Thu',e1e='Thumbnail',Aje='Thursday',kDe='TileEditingSample',_qe='TileGrid',Dqe='TileLayout',Jse='TileRecord',lDe='TileView',i1e='Tiled views can be connected to editors. The TiledView automatically reacts to changes to the underlying dataset. Change the life span of Gazelle to 2 to see it animate to the beginning of the list.',d1e='Tiled views can load data from services via DataSources, just like other data-aware components. Enter a search term to search Yahoo Images and display available images as tiles.',Lme='Time',dse='TimeItem',Ame='Timeline',NLe='Tin',ine='Title',xme='To',Mme='Today',cTe='Tokyo',kne='Tomorrow',Vje='Too many percent/per mille characters in pattern "',Kqe='ToolStrip',vqe='ToolStripButton',ire='ToolStripG
